// src/components/Pantry/ItemList.js
import React from "react";
import "./Pantry.css";

const ItemList = ({ items }) => {
  return (
    <div className="item-list">
      <h3>Current Pantry Items:</h3>
      <ul>
        {items.map((item, index) => (
          <li key={index}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default ItemList;
